import { AxiosRequestConfig } from 'axios'

export interface Credentials {
  username: string
  password: string
}

export const onLogin = async (data: Credentials) => {
  const requestConfig: AxiosRequestConfig = {
    method: 'post',
    url: 'http://localhost:4000/auth/login',
    data,
  }
}
